function clamp(n: number, min: number, max: number) {
  return Math.max(min, Math.min(max, n));
}

function valueToAngle(
  rawValue: number,
  ticks = TICKS,
  minAngle = -90,
  maxAngle = 90,
) {
  const minV = ticks[0];
  const maxV = ticks[ticks.length - 1];

  const v = clamp(rawValue, minV, maxV);

  let i = 0;
  while (i < ticks.length - 2 && v > ticks[i + 1]) i++;

  const v0 = ticks[i];
  const v1 = ticks[i + 1];

  const step = (maxAngle - minAngle) / (ticks.length - 1);
  const t = v1 === v0 ? 0 : (v - v0) / (v1 - v0);

  const result = minAngle + (i + t) * step;

  return result;
}

